import{_ as a,c as l,a8 as r,o as t}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"Готові апарати (Мультикоптер)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/complete_vehicles_mc/index.md","filePath":"uk/complete_vehicles_mc/index.md"}'),i={name:"uk/complete_vehicles_mc/index.md"};function o(h,e,c,n,s,m){return t(),l("div",null,e[0]||(e[0]=[r('<h1 id="готові-апарати-мультикоптер" tabindex="-1">Готові апарати (Мультикоптер) <a class="header-anchor" href="#готові-апарати-мультикоптер" aria-label="Permalink to &quot;Готові апарати (Мультикоптер)&quot;">​</a></h1><p>У цьому розділі міститься інформація про повністю зібрані готові до польоту (RTF) або майже готові до польоту транспортні засоби, які або за замовчуванням працюють з PX4, або можуть/можуть бути використані з PX4.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Це маленька підмножина транспортних засобів, які можуть працювати з PX4. Ви можете знайти інші на <a href="https://px4.io/ecosystem/commercial-systems/" target="_blank" rel="noreferrer">px4.io</a> та у <a href="./../airframes/airframe_reference.html">Довіднику з конструкцій</a>.</p></div><h2 id="набори-для-розробки-дронів-посилання-на-платформи" tabindex="-1">Набори для розробки дронів/посилання на платформи <a class="header-anchor" href="#набори-для-розробки-дронів-посилання-на-платформи" aria-label="Permalink to &quot;Набори для розробки дронів/посилання на платформи&quot;">​</a></h2><p>Цей розділ містить перелік наборів дронів, які призначені як платформи для подальшого розвитку. Вони можуть бути як повністю зібраними, так і у частинах.</p><ul><li><a href="./../complete_vehicles_mc/modalai_starling.html">MODALAI VOXL 2 STARLING PX4 РОЗРОБКА ДРОНА</a> - ДРОН ДЛЯ РОЗРОБКИ SLAM, ПОТУЖЕНИЙ НАДМІЧКОЮ VOXL 2 ТА PX4.</li><li><a href="./../complete_vehicles_mc/px4_vision_kit.html">PX4 Vision DevKit</a> - Мультикоптер, що використовується для розробки комп&#39;ютерного зору PX4</li></ul><h2 id="попередньо-встановлене-px4" tabindex="-1">Попередньо встановлене PX4 <a class="header-anchor" href="#попередньо-встановлене-px4" aria-label="Permalink to &quot;Попередньо встановлене PX4&quot;">​</a></h2><p>У цьому розділі перелічені транспортні засоби, які продаються повністю зібраними та готові до польоту (RTF), з встановленим PX4.</p><ul><li><a href="https://tealdrones.com/teal-one/" target="_blank" rel="noreferrer">Teal One</a></li><li><a href="./../complete_vehicles_mc/modalai_starling.html">ModalAI Starling</a></li><li><a href="https://www.modalai.com/sentinel" target="_blank" rel="noreferrer">ModalAI Sentinel</a></li><li><a href="./../complete_vehicles_mc/mindracer210.html">MindRacer 210</a></li><li><a href="./../complete_vehicles_mc/nanomind110.html">NanoMind 110</a></li></ul><h2 id="сумісні-з-px4" tabindex="-1">Сумісні з PX4 <a class="header-anchor" href="#сумісні-з-px4" aria-label="Permalink to &quot;Сумісні з PX4&quot;">​</a></h2><p>У цьому розділі перераховані апарати, де ви можете оновити програмне забезпечення для роботи з PX4.</p><ul><li><a href="./../complete_vehicles_mc/holybro_kopis2.html">Holybro Kopis 2</a></li><li><a href="./../complete_vehicles_mc/crazyflie21.html">Bitcraze Crazyflie 2.1</a></li><li><a href="./../complete_vehicles_mc/betafpv_beta75x.html">BetaFPV Beta75X 2S Brushless Whoop</a> (припинено)</li></ul><h2 id="кастомне-px4" tabindex="-1">Кастомне PX4 <a class="header-anchor" href="#кастомне-px4" aria-label="Permalink to &quot;Кастомне PX4&quot;">​</a></h2><p>Цей розділ містить споживчі транспортні засоби, які працюють на <em>спеціальній</em> версії PX4 (підтримується їхніми постачальниками). Вони можуть оновлюватися або не оновлюватися для запуску &quot;vanilla&quot; PX4.</p><ul><li><a href="https://us.yuneec.com/typhoon-h-plus/" target="_blank" rel="noreferrer">Yuneec Typhoon H Plus</a></li><li><a href="https://px4.io/portfolio/yuneec-mantis-q/" target="_blank" rel="noreferrer">Yuneec Mantis Q</a></li><li><a href="https://px4.io/portfolio/yuneec-h520-hexacopter/" target="_blank" rel="noreferrer">Yuneec H520</a></li><li><a href="https://px4.io/portfolio/aerosense-aerobo/" target="_blank" rel="noreferrer">AeroSense Aerobo (AS-MC02-P)</a></li></ul><h2 id="дивіться-також" tabindex="-1">Дивіться також <a class="header-anchor" href="#дивіться-також" aria-label="Permalink to &quot;Дивіться також&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/kits.html">Комплекти (MC)</a></li><li><a href="./../frames_multicopter/diy_builds.html">DIY Збірки</a></li><li><a href="./../complete_vehicles_vtol/README.html">Повні транспортні засоби (VTOL)</a></li><li><a href="./../complete_vehicles_fw/README.html">Повні Транспортні Засоби (Фіксовані Крила)</a></li></ul>',17)]))}const _=a(i,[["render",o]]);export{f as __pageData,_ as default};
